import React,{useState} from "react";
import Carde from "../component/Card";


const Productview = (props)=>{
const[title, setTitle] = useState(" ");
  const geturl = (url)=>{
     setTitle(url);
  }
    
    return (

        <>
        <h1 onMouseEnter={geturl} >this is product view page</h1>
        <div>

        <img src={props.imgsc}/>
        
        <div>
            <p>{title}</p>
        </div>
        </div>
        <Carde myurl={geturl}/>
        </>
    )
}

export default Productview;
